in javascript i have a long string (up to 100 characters). I want to be able to encode this string into a short string so it's easily shareable via a url and then decode the shared string
model
Sure, here is the code to encode a long string into a short string using Base64 encoding:

```javascript
const encodeLongString = (str) => {
  return btoa(str);
};

const decodeLongString = (encodedStr) => {
  return atob(encodedStr);
};
```

Here's an example usage:
```js
const str = "This is a long string that would be difficult to share via a URL.";
const encodedStr = encodeLongString(str);
console.log(encodedStr); // Output: "

